import React, { Component } from 'react';
import { Row, Col, Card } from "reactstrap";

//Import Image
import features from "../../assets/images/crypto/features-img/img-1.png"

class CardWelcome extends Component {
    render() {
        return (
            <React.Fragment>
            <Card>
                <div>
                    <Row>
                        <Col lg="9" sm="8">
                            <div  className="p-4">
                                <h5 className="text-primary">Welcome Back !</h5>
                                <p>Skote Crypto Dashboard</p>

                                <div className="text-muted">
                                    <p className="mb-1"><i className="mdi mdi-circle-medium align-middle text-primary mr-1"></i> If several languages coalesce</p>
                                    <p className="mb-1"><i className="mdi mdi-circle-medium align-middle text-primary mr-1"></i> Sed ut perspiciatis unde</p>
                                    <p className="mb-0"><i className="mdi mdi-circle-medium align-middle text-primary mr-1"></i> It would be necessary</p>
                                </div>
                            </div>
                        </Col>
                        <Col lg="3" sm="4" className="align-self-center">
                            <div>
                                <img src={features} alt="" className="img-fluid d-block"/>
                            </div>
                        </Col>
                    </Row>
                </div>
            </Card>
            </React.Fragment>
        );
    }
}

export default CardWelcome;
